def formStringXNumberOfCharacters(character, num):
    ret = ""
    for i in range(0, num):
        ret += character
    return ret

def getParcelNumbersFromRandomPrefixSearches(format, prefix, municipalityID):
    # 33-01-__-__-___-___
    numberSearchStrng = str(prefix)
    prefixSections = prefix.split("-")
    for idx, numChars in enumerate(format):
        if idx < len(prefixSections):
            continue
        numberSearchStrng += formStringXNumberOfCharacters("_", numChars)

    url = 'https://accessmygov.com/SiteSearch/SiteSearchResults?SearchFocus=All+Records&SearchCategory=Parcel+Number&SearchText={0}&uid={1}&SearchOrigin=0&SortBy=Name'.format(numberSearchStrng, municipalityID)
    return getAllPagedParcelNumbers(url)



def getParcelNumbersFromRandomNameSearches(municipalityID):
    ret = Set()
    baseUrl = 'https://accessmygov.com/SiteSearch/SiteSearchResults?SearchFocus=All+Records&SearchCategory=Name&SearchText={0}&uid={1}&SearchOrigin=0&SortBy=Name'
    letters = ["a", "e", "i", "n", "t"]
